package com.example.prescription_module.domain;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;@Entitypublic class MedicationPrescription {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPrescription;    private Long idMedication;    private String dosage;    private String instructions;    public MedicationPrescription() {    }    public MedicationPrescription(Long idPrescription, Long idMedication, String dosage, String instructions) {        this.idPrescription = idPrescription;        this.idMedication = idMedication;        this.dosage = dosage;        this.instructions = instructions;    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public Long getIdPrescription() {        return idPrescription;    }    public void setIdPrescription(Long idPrescription) {        this.idPrescription = idPrescription;    }    public Long getIdMedication() {        return idMedication;    }    public void setIdMedication(Long idMedication) {        this.idMedication = idMedication;    }    public String getDosage() {        return dosage;    }    public void setDosage(String dosage) {        this.dosage = dosage;    }    public String getInstructions() {        return instructions;    }    public void setInstructions(String instructions) {        this.instructions = instructions;    }}